import { useSelector } from 'react-redux'
import Col from 'react-bootstrap/Col'
import Row from 'react-bootstrap/Row'
import CardTodo from '../CardTodo'

const ListTodo = () => {

  const todos = useSelector(
    (state) => {
      state.todos.todo
    }
  )

  return (
    <Row>
      {todos && todos.map( ({id, done, date, description}) => (
        <Col key={todos.id}>
          <CardTodo id={todos.id} done={todos.done} date={todos.date} description={todos.description} />
        </Col>
      ) )}        
    </Row>
  )  
}

export default ListTodo
